 Ti.API.log prints wrong module signs on output.


*index.xml*

{code}
<Alloy>
	<Window class="container">
		<Label id="label" onClick="doClick">Hello, World</Label>
	</Window>
</Alloy>
{code}
*index.js*
{code}
function doClick(e) {
    alert($.label.text);
    
    Ti.API.log('%');
}

$.index.open();
{code}


